COPY public.services (id, slug, image_url, is_active, created_at, updated_at, name_fr, name_en, short_description_fr, short_description_en, full_description_fr, full_description_en) FROM stdin;
5	tutorat-aide-au-savoir	/uploads/services/service-1748544248023-673626434.jpg	t	2025-05-29 13:06:07.926842	2025-05-29 18:44:08.326	Tutorat AIDE AU SAVOIR	Tutoring HELP TO KNOWLEDGE	La Coopérative de Solidarité Arcade a mis sur pied un groupe de tutorat appelé AIDE AU ...	The Arcade Solidarity Cooperative has set up a tutoring group called HELP TO KNOWLEDGE.	« On ne peut donner que deux choses à ses enfants : des racines et des ailes » (Proverbe juif)\nLa Coopérative de Solidarité Arcade a mis sur pied un groupe de tutorat appelé AIDE AU SAVOIR, dont la mission est de promouvoir le succès des élèves immigrants qui intègrent les écoles primaires et secondaires. Partant du constat qu’une grande partie des enfants se retrouvent dans un cheminement scolaire ne les conduisant pas vers les métiers valorisés et valorisants, la Coop Arcade a ainsi mis sur pied ce groupe de tutorat « aide au savoir » pour encadrer et accompagner les jeunes afin qu’ils atteignent leur plein potentiel. Les bons résultats scolaires obtenus leur permettront, par voie de conséquence, d’être orientés dans les filières de leur choix. La vision à long terme à la base de cette initiative va plus loin que la simple aide aux devoirs. Elle est ancrée dans la leçon que donne ce proverbe de la sagesse populaire juive : « On ne peut donner que deux choses à ses enfants : des racines et des ailes ». Elle vise à préparer les jeunes à prendre leur élan, à leur donner des ailes, à leur donner des savoirs et des savoir-être, afin qu’ils puissent espérer occuper un jour des postes de responsabilité dans tous les domaines valorisés et valorisants (médecine, génie, sciences juridiques, etc.).\n\nA. Objectifs\n1- Aider les parents à comprendre la philosophie de l’enseignement du Canada;\n2- Contribuer à orienter la trajectoire scolaire et professionnelle des jeunes, dès les bancs de l’école primaire et de l’école secondaire;\n3- Aider les jeunes à se découvrir, à développer leur estime de soi, et à développer les valeurs d’intégrité et de justice ;\n4- Inculquer aux jeunes la soif de la connaissance ainsi que les aptitudes et les attitudes liées au leadership.\n\nB. Horaire Tous les soirs en semaine de 16h à 19h et samedi entre 10 h et 15 h : (dans cet intervalle de temps, chaque enfant choisira au minimum deux heures de suivi selon la disponibilité des adultes qui l’amènent sur le lieu du tutorat).\n\nC. Coût 1- Un élève régulier (présence à toutes les séances): 20 $ l’heure.\n2- Pour un élève qui participe de façon irrégulière : 25 $l’heure.\n3- Pour les familles ayant plusieurs enfants inscrits et qui participent de façon régulière :\n1er enfant : 20 $ l’heure\nAutres enfants : forfait de 27 $ l’heure\nPour les familles ayant plusieurs enfants inscrits mais qui participent de façon irrégulière :\n1er enfant : 25 $ l’heure.\nAutres enfants : forfait de 20 $ l’heure.\n\nN.B. Pour des parents qui ont des empêchements justifiables et qui ne peuvent pas déposer les enfants sur le lieu du tutorat, l’équipe pourra organiser l’aller-retour de la résidence au lieu du tutorat au coût de 20 $.\nNous serons heureux d’accueillir vos enfants à Gatineau dans les locaux situés au numéro 9, rue Amherst, Gatineau - Hull.\nVeuillez remplir le formulaire d’inscription y relatif et le retourner le premier jour de votre présentation au local.	"You can only give two things to your children: roots and wings" (Jewish Proverb). The Arcade Solidarity Cooperative has set up a tutoring group called HELP TO KNOWLEDGE, whose mission is to promote the success of immigrant students who integrate primary and secondary schools. Starting from the observation that a large part of children find themselves in an educational path that does not lead them to valued and rewarding professions, Coop Arcade has thus set up this tutoring group "help to knowledge" to supervise and accompany young people so that they reach their full potential. The good academic results obtained will allow them, consequently, to be oriented in the streams of their choice. The long-term vision at the base of this initiative goes further than simple homework help. It is anchored in the lesson given by this proverb of Jewish popular wisdom: "You can only give two things to your children: roots and wings". It aims to prepare young people to take their momentum, to give them wings, to give them knowledge and know-how, so that they can hope to occupy positions of responsibility one day in all valued and rewarding fields (medicine, engineering, legal sciences, etc.).
2	aide-aux-familles	/uploads/services/service-1748544094646-23885403.jpg	t	2025-05-29 13:03:27.48239	2025-05-29 18:41:35.002	Aide aux familles	Family Assistance	Grâce aux ententes de paiement conclues avec un certain nombre d’institutions de microf...	Thanks to payment agreements concluded with microfinance institutions and telecommunications actors.	Grâce aux ententes de paiement conclues avec un certain nombre d’institutions de microfinances et des acteurs des télécommunications du pays d’origine avec la Coop, nous rendons un service de proximité aux familles dont certains membres, restés au pays, attendent un regroupement.\n\nLe Canada étant un pays d’immigration, le soutien financier par envoi d’argent par les moyens classiques devient quasiment inopérant pour assister les membres de la famille qui habitent loin des grands centres urbains au pays natal. Au Burundi, la faible pénétration bancaire rend donc indispensable le recours aux outils innovants de transferts d’argent, notamment le transfert par téléphone mobile (mobile money).\n\nDans le sens inverse, les transferts d’argent sont aussi un casse-tête : des gens du pays d’origine voulant effectuer des paiements sociaux aux leurs se trouvant au Canada, comme les frais de subsistance aux étudiants internationaux, se heurtent à des problèmes insurmontables. La rareté des devises étrangères au pays ajoute à la difficulté de ces transactions.\n\nDeux types de paiements fonctionnant en mode compensatoire se font : paiement en monnaie locale au pays et/ou inversement, paiement de services en $ canadiens pour les membres.	Thanks to payment agreements concluded with a number of microfinance institutions and telecommunications actors from the country of origin with the Coop, we provide proximity services to families whose certain members, who remained in the country, are awaiting reunification. Canada being a country of immigration, financial support by sending money through classic means becomes almost inoperative to assist family members who live far from major urban centers in the natal country. In Burundi, low banking penetration makes it essential to use innovative money transfer tools, particularly mobile phone transfer (mobile money). In the opposite direction, money transfers are also a headache: people from the country of origin wanting to make social payments to theirs in Canada, such as subsistence fees to international students, face insurmountable problems. The scarcity of foreign currencies in the country adds to the difficulty of these transactions. Two types of payments operating in compensatory mode are made: payment in local currency in the country and/or conversely, payment of services in Canadian dollars for members.
1	paniers-ménagers	/uploads/services/service-1748543945815-366205445.jpg	t	2025-05-29 13:00:55.461277	2025-05-29 18:39:06.322	Paniers ménagers	Household Baskets	La Coop. Arcade est en phase d’expérimentation de son produit « Panier de la ménagèr...	Coop. Arcade is in the experimental phase of its "Household Basket" product.	La Coop. Arcade est en phase d’expérimentation de son produit « Panier de la ménagère Gisabo et bien plus…». Ce service porte sur la remise de cadeaux en nature en lieu et place du transfert d’argent classique. L’objectif est de donner à la diaspora une occasion d’offrir aux siens des dons en nature comme une façon, ancrée dans notre culture d’origine, d’exprimer la force de leurs liens avec les gens restés au pays (kugemura igisimbo en kirundi) et ce, malgré la distance. L’équipe locale au Burundi a créé un réseau de fournisseurs et se charge de connecter ces derniers avec les bénéficiaires. Un forfait en % est perçu au cas par cas. Il s’agit notamment de services suivants :\n\n- Carte cadeaux de produits alimentaires courants (riz, fruits et légumes, viande de boucherie, etc.);\n- Paiement d’abonnements aux produits laitiers : «gukamishiriza incuti»;\n- Paiement des services tels que l’eau et l’électricité, l’abonnement TV/Téléphone, …\n- Prime d’assurance-maladie privée pour parentés ;\n- Soutien aux études par paiement de frais de scolarité (minerval);\n- Divers cas personnels.\nLa tarification se fait au cas par cas par prélèvement de frais variant de 5% à 10%.	Coop. Arcade is in the experimental phase of its "Gisabo Household Basket and much more..." product. This service involves giving gifts in kind instead of the classic money transfer. The objective is to give the diaspora an opportunity to offer their loved ones gifts in kind as a way, rooted in our culture of origin, to express the strength of their ties with people who remained in the country (kugemura igisimbo in Kirundi) and this, despite the distance. The local team in Burundi has created a network of suppliers and is responsible for connecting them with beneficiaries. A percentage package is charged on a case-by-case basis. These include the following services: - Gift cards for common food products (rice, fruits and vegetables, butcher meat, etc.); - Payment of subscriptions to dairy products: "gukamishiriza incuti"; - Payment of services such as water and electricity, TV/Telephone subscription, ...; - Private health insurance premium for relatives; - Study support by payment of tuition fees (tuition); - Various personal cases. Pricing is done on a case-by-case basis by charging fees ranging from 5% to 10%.
3	etudiants-internationaux	/uploads/services/service-1748544227332-970661560.jpg	t	2025-05-29 13:04:35.787903	2025-05-29 18:43:47.719	Etudiants internationaux	International Students	Etudiants internationaux : informations sur les admissions, accueil et intégration. Disp...	International students: information on admissions, reception and integration.	a. Disponibilisation des outils et des informations d’orientation facultaire avant l’inscription ;\nb. Facilitation des paiements des droits exigés tout au long du processus de demande d’admission ;\nc. Orientation pour évaluation des acquis académiques ;\nd. Assistance/orientation concernant les démarches consulaires ;\ne. Organisation de séminaires d’intégration sociale des nouveaux étudiants ;\nf. Appui logistique dans la recherche d’un logement (au campus ou hors campus) pour les nouveaux étudiants ;\ng. Service d’accompagnement portant sur le paiement des droits de scolarité.	a. Provision of tools and faculty orientation information before registration; b. Facilitation of payments of fees required throughout the admission application process; c. Guidance for evaluation of academic achievements; d. Assistance/guidance concerning consular procedures; e. Organization of social integration seminars for new students; f. Logistical support in finding accommodation (on campus or off campus) for new students; g. Accompaniment service concerning the payment of tuition fees.
6	organisation-devenements-sociaux	/uploads/services/service-1748544261795-758829783.jpg	t	2025-05-29 13:19:35.371333	2025-06-02 12:48:22.062	Organisation d’événements sociaux	Social Event Organization	La Coop de Solidarité Arcade a toujours aidé dans l’organisation d’événements soci...	Complete planning and organization of social and cultural events for the African diaspora.	Organisation d’événements sociaux : la Coop Arcade avec vous, dans la joie et dans la peine\nLa Coop de Solidarité Arcade a toujours aidé dans l’organisation d’événements sociaux communautaires, heureux ou malheureux :\n\na. Mariage et/ou remise de dot : combo de services de soutien comprenant :\ni. Un service de protocole et une équipe chargée du service ;\nii. La location de décor artistique adapté à la culture d’origine ;\niii. Les groupes de danses traditionnelles.\n\nb. Anniversaire :\ni. La réservation d’une salle et sa préparation ;\nii. Le courtage d’un service traiteur ;\niii. La sonorisation (en cas de besoin).\n\nc. Décès :\ni. La coordination des intervenants : service religieux-protocole-pompes funèbres ;\nii. Le matériel de deuil, avec un cachet culturel distinctif ;\niii. L’organisation du transport des personnes (si requis).\n\nd. Levée de deuil\ni. La coordination des intervenants : service religieux-protocole-groupes culturels ;\nii.Le matériel de service et la préparation des lieux où prennent place les cérémonies ;\niii. L’organisation du transport.\n\nLa tarification des services et les modalités de paiement sont personnalisées en fonction de la commande.	Social event organization: Coop Arcade with you, in joy and in sorrow. Complete event organization service including planning, coordination, guest management and logistics for all types of social and cultural events.
